#ifdef HAVE_COMP_KEY
static const sp_digit p256_brainpool_sqrt_power[4] = {
    0x0804d20747db94deL,0x9b8efd88f549880aL,0x0f9982a42760e35cL,
    0x2a7ed5f6e87baa6fL
};
/* Find the square root of a number mod the prime of the curve.
 *
 * y  The number to operate on and the result.
 * returns MEMORY_E if dynamic memory allocation fails and MP_OKAY otherwise.
 */
static int sp_256_mont_sqrt_brainpool_4(sp_digit* y)
{
#if defined(WOLFSSL_SMALL_STACK) && !defined(WOLFSSL_SP_NO_MALLOC)
    sp_digit* t = NULL;
#else
    sp_digit t[2 * 4];
#endif
    int err = MP_OKAY;

#if defined(WOLFSSL_SMALL_STACK) && !defined(WOLFSSL_SP_NO_MALLOC)
    t = (sp_digit*)XMALLOC(sizeof(sp_digit) * 2 * 4, NULL, DYNAMIC_TYPE_ECC);
    if (t == NULL)
        err = MEMORY_E;
#endif

    if (err == MP_OKAY) {

        {
            int i;

            XMEMCPY(t, y, sizeof(sp_digit) * 4);
            for (i=252; i>=0; i--) {
                sp_256_mont_sqr_brainpool_4(t, t, p256_brainpool_mod, p256_brainpool_mp_mod);
                if (p256_brainpool_sqrt_power[i / 64] & ((sp_digit)1 << (i % 64)))
                    sp_256_mont_mul_brainpool_4(t, t, y, p256_brainpool_mod, p256_brainpool_mp_mod);
            }
            XMEMCPY(y, t, sizeof(sp_digit) * 4);
        }
    }

#if defined(WOLFSSL_SMALL_STACK) && !defined(WOLFSSL_SP_NO_MALLOC)
    if (t != NULL)
        XFREE(t, NULL, DYNAMIC_TYPE_ECC);
#endif

    return err;
}


/* Uncompress the point given the X ordinate.
 *
 * xm    X ordinate.
 * odd   Whether the Y ordinate is odd.
 * ym    Calculated Y ordinate.
 * returns MEMORY_E if dynamic memory allocation fails and MP_OKAY otherwise.
 */
int sp_ecc_uncompress_brainpool_256(mp_int* xm, int odd, mp_int* ym)
{
#if defined(WOLFSSL_SMALL_STACK) && !defined(WOLFSSL_SP_NO_MALLOC)
    sp_digit* x = NULL;
#else
    sp_digit x[4 * 4];
#endif
    sp_digit* y = NULL;
    int err = MP_OKAY;

#if defined(WOLFSSL_SMALL_STACK) && !defined(WOLFSSL_SP_NO_MALLOC)
    x = (sp_digit*)XMALLOC(sizeof(sp_digit) * 4 * 4, NULL, DYNAMIC_TYPE_ECC);
    if (x == NULL)
        err = MEMORY_E;
#endif

    if (err == MP_OKAY) {
        y = x + 2 * 4;

        sp_256_from_mp(x, 4, xm);
        err = sp_256_mod_mul_norm_brainpool_4(x, x, p256_brainpool_mod);
    }
    if (err == MP_OKAY) {
        /* y = x^3 */
        {
            sp_256_mont_sqr_brainpool_4(y, x, p256_brainpool_mod, p256_brainpool_mp_mod);
            sp_256_mont_mul_brainpool_4(y, y, x, p256_brainpool_mod, p256_brainpool_mp_mod);
        }
        /* y = x^3 - 3x */
        sp_256_mont_sub_brainpool_4(y, y, x, p256_brainpool_mod);
        sp_256_mont_sub_brainpool_4(y, y, x, p256_brainpool_mod);
        sp_256_mont_sub_brainpool_4(y, y, x, p256_brainpool_mod);
        /* y = x^3 - 3x + b */
        err = sp_256_mod_mul_norm_brainpool_4(x, p256_brainpool_b, p256_brainpool_mod);
    }
    if (err == MP_OKAY) {
        sp_256_mont_add_brainpool_4(y, y, x, p256_brainpool_mod);
        /* y = sqrt(x^3 - 3x + b) */
        err = sp_256_mont_sqrt_brainpool_4(y);
    }
    if (err == MP_OKAY) {
        XMEMSET(y + 4, 0, 4U * sizeof(sp_digit));
        sp_256_mont_reduce_brainpool_4(y, p256_brainpool_mod, p256_brainpool_mp_mod);
        if ((((word32)y[0] ^ (word32)odd) & 1U) != 0U) {
            sp_256_mont_sub_brainpool_4(y, p256_brainpool_mod, y, p256_brainpool_mod);
        }

        err = sp_256_to_mp(y, ym);
    }

#if defined(WOLFSSL_SMALL_STACK) && !defined(WOLFSSL_SP_NO_MALLOC)
    if (x != NULL)
        XFREE(x, NULL, DYNAMIC_TYPE_ECC);
#endif

    return err;
}
#endif
